import { Grid, Typography, IconButton, Paper } from '@material-ui/core';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
// import ListItemButton from '@material-ui/core/ListItemButton';
import Divider from '@material-ui/core/Divider';
import AddIcon from '@material-ui/icons/Add';
import RemoveCircleIcon from '@material-ui/icons/RemoveCircle';
import LocalBarIcon from '@material-ui/icons/LocalBar';


import useStyles from './styles';


function Places({ places, addToList, isOnList, removeFromList }) {
  const classes = useStyles();

  return (

    <Paper style={{ maxHeight: '70vh', overflow: 'auto'}}>

      <List sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}>
        {places?.map((place, i) =>
          <>
          <ListItem alignItems="flex-start">
            <ListItemText
              primary={place.name}
              secondary={
                <>
                  <Typography
                    sx={{ display: 'inline' }}
                    component="span"
                    variant="body2"
                    color="text.primary"
                  >
                    Yo
                  </Typography>
                  {" — I'll be in your neighborhood doing errands this…"}
                </>
              }
            />
            {!isOnList(place) ?

              <IconButton

                onClick={() => {
                  addToList({name: place.name, photo: place.photos[0].photo_reference})
                  console.log(place)
                }}
              >
                <AddIcon style={{color: '#99b27f'}}/>
                <LocalBarIcon />
              </IconButton> :
              <IconButton
                onClick={() => {
                  console.log('test')
                  removeFromList({name: place.name})
                }}
              >

                <RemoveCircleIcon />
              </IconButton>
            }
          </ListItem>
          <Divider variant="inset" component="li" />
          </>
        )}
      </List>
    </Paper>
  )
}

export default Places;
